public class ProtocolMetaData {
    public static final String VERSION = "3.0";
    public static final String OEJB = "W3EP";
    public transient String id;
    public transient int major;
    public transient int minor;

    public ProtocolMetaData() {
        this.init("W3EP/3.0");
    }

    public ProtocolMetaData(String version) {
        this.init("W3EP/" + version);
    }

    public void init(String spec) {
        if (!spec.matches("^W3EP/[0-9]\\.[0-9]$")) {
            throw new RuntimeException("Protocol version spec must follow format [ \"W3EP\" \"/\" 1*DIGIT \".\" 1*DIGIT ] - " + spec);
        } else {
            char[] chars = new char[8];
            spec.getChars(0, chars.length, chars, 0);
            this.id = new String(chars, 0, 4);
            this.major = Integer.parseInt(new String(chars, 5, 1));
            this.minor = Integer.parseInt(new String(chars, 7, 1));
        }
    }

public void readExternal(InputStream in) throws IOException {
    byte[] spec = new byte[8];

    for (int i = 0; i < spec.length; ++i) {
        spec[i] = (byte) in.read();
        if (spec[i] == -1) {
            throw new EOFException("Unable to read protocol version.  Reached the end of the stream.");
        }
    }

    try {
        this.init(new String(spec, "UTF-8"));
    } catch (Throwable e) {
        throw new IOException("Failed to read spec: " + Arrays.toString(spec), e);
    }
}

